import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

function App(props) {
    if (props.rota === 'Login') {
        return <Login onCadastrar={props.onCadastrar}/>;
    } else if (props.rota === 'Cadastro') {
        return <Cadastro onVoltar={props.onVoltar}/>;
    }
}

export default App;
